Here is a sample code for a chrome extension that takes screenshots of a website and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A chrome extension that takes screenshots of a website and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "storage",
    "tabs"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}

// background.js
chrome.runtime.onInstalled.addListener(function() {
  chrome.storage.sync.set({folder: ""}, function() {
    console.log("Folder set to empty string.");
  });
});

chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === "complete") {
    chrome.storage.sync.get(["folder"], function(result) {
      if (result.folder) {
        chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
          var filename = result.folder + "/" + tab.title + ".png";
          chrome.downloads.download({
            url: dataUrl,
            filename: filename
          });
        });
      }
    });
  }
});

// popup.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <script src="popup.js"></script>
  </ head>
  <body>
    <button id="take-screenshot">Take Screenshot</button>
    <div id="status"></div>
  </body>
</html>

// popup.js
document.getElementById("take-screenshot").addEventListener("click", function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
      var filename = chrome.storage.sync.get(["folder"], function(result) {
        if (result.folder) {
          filename = result.folder + "/" + tabs[0].title + ".png";
        } else {
          filename = "screenshot.png";
        }
      });
      chrome.downloads.download({
        url: dataUrl,
        filename: filename
      });
    });
  });
});
```
In this code, we first define the manifest.json file which contains the metadata for our extension. We specify the name, version, description, permissions, and other details of our extension. We also specify the background script and the popup page.

