# React CSS

## Inline Styles

Inline styles are the most basic way to style a react component. You can use the style prop to add inline styles to a component. The style prop takes an object with CSS properties as keys and values. For example, to add a background color to a div, you can use the following code:
```
<div style={{ backgroundColor: 'red' }}>Hello World!</div>
```
## CSS Modules

CSS Modules allow you to write CSS in a component-specific scope. This means that you can use the same class name in different components without worrying about name collisions. To use CSS Modules, you need to create a CSS file and import it into your component. For example, to create a CSS file for a component called MyComponent, you can create a file called MyComponent.css and import it into your component like this:
```
import React from 'react';
import styles from './MyComponent.css';

const MyComponent = () => {
  return (
    <div className={styles.container}>
      <h1 className={styles.title}>Hello World!</h1>
    </div>
  );
};

export default MyComponent;

